//leetcode submit region begin(Prohibit modification and deletion)
function numDifferentIntegers(word: string): number {
    // Extract only numbers from string
    let regex: RegExp = /[\d]+/g
    let match: RegExpExecArray | null
    let results: Set<BigInt> = new Set()

    while (match = regex.exec(word)) {
        results.add(BigInt(match[0]))
    }

    return results.size
};
//leetcode submit region end(Prohibit modification and deletion)

// 1805-number-of-different-integers-in-a-string

console.assert(numDifferentIntegers("a123bc34d8ef34") == 3)
console.assert(numDifferentIntegers("leet1234code234") == 2)
console.assert(numDifferentIntegers("a1b01c001") == 1)
console.assert(numDifferentIntegers("") == 3)

